def solution(stdin: str) -> str:
    n = int(stdin)
    s = stdin.strip().split("\n")
    s.sort()
    # This solution would solve the problem. But the speed is not good enough for
    # the problem. This solution is too slow.
    # pairs = []
    # for i in range(n):
    #     for j in range(i + 1, n):
    #         if s[i] == s[j]:
    #             pairs.append((i, j))
    # return str(len(pairs))
    # This solution can solve the problem in faster way.
    # In this solution, we use hash table to store the characters
    # appearing in strings. Then we use two pointers to keep track
    # of the current characters. The right pointer is used to check
    # if the left pointer has been visited or not. If the left
    # pointer is not visited, then we increment the current number of
    # pairs. If the left pointer is visited, then we reset the number
    # of pairs to 0 and increment the left pointer.
    hashtable = {}
    pairs = 0
    for i in s:
        for j in range(len(i)):
            if i[j] not in hashtable:
                hashtable[i[j]] = 1
            else:
                hashtable[i[j]] += 1
    for i in range(len(s)):
        for j in range(len(s)):
            if i!= j:
                if hashtable[s[i][j]] == 1:
                    pairs += 1
                hashtable[s[i][j]] -= 1
    return str(pairs)

def solution(stdin: str) -> str:
    n, k = map(int, stdin.readline().split())
    roads = [tuple(map(int, line.split())) for line in stdin.readlines()]
    cities = [False] * n
    for i, j in roads:
        cities[i - 1] = True
        cities[j - 1] = True

    def is_good(city: int) -> bool:
        return city not in cities

    def is_good_cities(cities: list) -> bool:
        return sum(map(is_good, cities)) <= k

    def is_good_range(r: int) -> bool:
        return is_good_cities(roads[:r])

    def is_good_range_n(r: int, n: int) -> bool:
        for i in range(n - 1):
            if not is_good_cities(roads[i:i + r]):
                return False
        return True

    def range_sizes(n: int) -> list[int]:
        return [0] * (n - 1) + [n - 1] * (n - 1)

    def r_solutions(r: int, n: int) -> list[int]:
        def helper(r: int, i: int, solutions: list[int]) -> list[int]:
            if i == n:
                if is_good_range(r):
                    solutions.append(r)
            else:
                helper(r, i + 1, solutions)
                if is_good_range_n(r, n):
                    helper(r + 1, i + 1, solutions)

        return [0]

    def solution(n: int) -> list[int]:
        solutions = []
        for i in range(n - 1):
            if is_good_range(i + 1):
                helper(i + 1, i + 1, solutions)
        return solutions

    return str(len(solution(n))) + '\n' + '\n'.join(map(str, solution(n)))

