    n, m, k = map(int, stdin.split())
    objs = [int(o) for o in stdin.split()]

    result = 0
    for i in range(len(objs)):
        # finding the first available box and putting the object there
        box_index = 0
        available = [box_index]
        objs_in_box = 0
        for j in range(i, len(objs)):
            if objs_in_box < k:
                objs_in_box += objs[j]
                available.append(j)
            else:
                break
        objs_in_box = 0

        # trying to pack all the remaining objects
        for j in range(i, len(objs)):
            if objs_in_box < k:
                objs_in_box += objs[j]
            else:
                # if any of the remaining objects cannot be put in the current box,
                # then the algorithm will stop and we have a result
                result = max(result, j - i + 1)
                break

        for box_index in available:
            objs_in_box = 0
            for j in range(i, box_index):
                if objs_in_box < k:
                    objs_in_box += objs[j]
                else:
                    break
            if objs_in_box < k:
                objs_in_box += objs[box_index]
                result = max(result, j - i + 1)

    return str(result)


