class Solution:
    def plusOne(self, digits: List[int]) -> List[int]:
        if len(digits) == 0:
            return []
        carry = 1
        i = len(digits) - 1
        while carry > 0 and i >= 0:
            digits[i] += carry
            carry = digits[i] // 10
            digits[i] %= 10
            i -= 1
        if carry > 0:
            digits = [carry] + digits
        return digits

